const NavBar = () => {
    return (
        <>
                  <div class="container mx-auto flex flex-wrap p-5 pt-20 flex-col md:flex-row items-center">

                    <img href="https://www.youtube.com/c/ColinandSamir/videoscolinandsamir.com" className="absolute left-0 h-[150px] w-[150px] ml-10 " src={require('./cnslogo.png')} />
                    <img className="absolute right-0 h-[150px] w-[150px] mr-10 " src={require('./Plogo.png')} />
                </div>
        </>
    )
}

export default NavBar;
